import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faMailForward } from '@fortawesome/free-solid-svg-icons';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
    <footer className='footer'>
      <div className='footer__content'>
        <div> <FontAwesomeIcon icon={faMailForward}/> <a href="mailto:shruti15bakutra@gmail.com" target="_blank">shruti15bakutra@gmail.com</a></div>
        <div> Address: Challex, France</div>
        <div> LinkedIn: <a href='https://www.linkedin.com/in/shruti-bakutra-037829156/'> https://www.linkedin.com/in/shruti-bakutra-037829156/</a></div>
      </div>
    </footer>
  </React.StrictMode>
);

reportWebVitals();
